import React from 'react';
import '../src/k'

const kanban = ({ groupedAndSortedTickets }) => {
  return (
    <div className="kanban-board">
      {groupedAndSortedTickets.map((group) => (
        <div key={group.key} className="kanban-column">
          <h2>{group.key}</h2>
          <ul>
            {group.tickets.map((ticket) => (
              <li key={ticket.id}>
                <strong>{ticket.title}</strong> - {ticket.status}, {ticket.user}, Priority: {ticket.priority}
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default kanban;
